ISLAMABAD, Jun 17 (APP):Chairman Senate Syed Yousaf Raza Gillani on Tuesday welcomed the Ambassador of Romania to Pakistan, H. E. Dan Stoenescu, during his visit to the Senate, where he also witnessed the ongoing proceedings of the Senate.
The Chairman extended warm greetings to Ambassador Stoenescu and appreciated the longstanding diplomatic relations between Pakistan and Romania. He expressed hope for continued parliamentary cooperation and stronger bilateral engagement.
